

import math
import sys


MAX = 10004205361450474
QMAX = 10000

LOCAL = False


def inp():
    return sys.stdin.readline().rstrip()


ANS = -1
ROUNDS = 0
if LOCAL:
    ANS = int(inp())
    assert ANS <= MAX


def do_query(values):
    global ROUNDS

    if LOCAL:
        print('QUERY {}...{} (len={})'.format(
            values[0], values[-1], len(values)))

        ROUNDS += 1
        if max(values) > MAX:
            print('Value too large: {}'.format(max(values)))
            resp = -2
        try:
            i = values.index(ANS)
            print('CORRECT! ROUNDS={}'.format(ROUNDS))
            resp = -1
        except ValueError:
            if ROUNDS == 5:
                print('NOT SOLVED IN 5 ROUNDS.')
                resp = -2
            else:
                resp = len(values)
                for i, v in enumerate(values):
                    if ANS < v:
                        resp = i
                        break
        print('  => {}'.format(resp))
    else:
        print(len(values), *values, flush=True)
        resp = int(inp())
    if resp < 0:
        
        sys.exit()
    return resp


def trim_query(query):
    if max(query) <= MAX:
        return query

    res = [q for q in query if q <= MAX]
    if max(query) != MAX:
        res.append(MAX)
    return res


